/*
Other ui styels less template from the web
// This file has fallback variables. It specifies the variables themes
// must implement.

// Colors

@text-color: #333;
@text-color-subtle: #777;
@text-color-highlight: #111;
@text-color-selected: @text-color-highlight;

@text-color-info: #5293d8;
@text-color-success: #1fe977;
@text-color-warning: #f78a46;
@text-color-error: #c00;

@background-color-info: #0098ff;
@background-color-success: #17ca65;
@background-color-warning: #ff4800;
@background-color-error: #c00;
@background-color-highlight: hsla(0,0%,0%,.1);
@background-color-selected: @background-color-highlight;

@app-background-color: #fff;

@base-background-color: #fff;
@base-border-color: #eee;

@pane-item-background-color: @base-background-color;
@pane-item-border-color: @base-border-color;

@input-background-color: #fff;
@input-border-color: @base-border-color;

@tool-panel-background-color: #f4f4f4;
@tool-panel-border-color: @base-border-color;

@inset-panel-background-color: #eee;
@inset-panel-border-color: @base-border-color;

@panel-heading-background-color: #ddd;
@panel-heading-border-color: transparent;

@overlay-background-color: #f4f4f4;
@overlay-border-color: @base-border-color;

@button-background-color: #ccc;
@button-background-color-hover: lighten(@button-background-color, 5%);
@button-background-color-selected: @button-background-color-hover;
@button-border-color: #aaa;

@tab-bar-background-color: #fff;
@tab-bar-border-color: darken(@tab-background-color-active, 10%);
@tab-background-color: #f4f4f4;
@tab-background-color-active: #fff;
@tab-border-color: @base-border-color;

@tree-view-background-color: @tool-panel-background-color;
@tree-view-border-color: @tool-panel-border-color;

@ui-site-color-1: @background-color-success; // green
@ui-site-color-2: @background-color-info; // blue
@ui-site-color-3: @background-color-warning; // orange
@ui-site-color-4: #db2ff4; // purple
@ui-site-color-5: #f5e11d; // yellow


// Sizes

@font-size: 13px;
@input-font-size: 14px;

@disclosure-arrow-size: 12px;

@component-padding: 10px;
@component-icon-padding: 5px;
@component-icon-size: 16px;
@component-line-height: 25px;
@component-border-radius: 2px;

@tab-height: 30px;

// Other

@font-family: system-ui;
@use-custom-controls: true; // false uses native controls
*/
.github-DotComMarkdownHtml {
  font-size: 1.15em;
  line-height: 1.5;
}
.github-DotComMarkdownHtml > *:first-child {
  margin-top: 0;
}
.github-DotComMarkdownHtml > *:last-child {
  margin-bottom: 0;
}
.github-DotComMarkdownHtml h1,
.github-DotComMarkdownHtml h2,
.github-DotComMarkdownHtml h3,
.github-DotComMarkdownHtml h4,
.github-DotComMarkdownHtml h5,
.github-DotComMarkdownHtml h6 {
  line-height: 1.2;
  margin-top: 1em;
  margin-bottom: 0.33333333em;
  color: #f0f0f0;
}
.github-DotComMarkdownHtml h1 {
  font-size: 1.5em;
  font-weight: 400;
}
.github-DotComMarkdownHtml h2 {
  font-size: 1.3em;
  font-weight: 400;
}
.github-DotComMarkdownHtml h3 {
  font-size: 1.2em;
  font-weight: 500;
}
.github-DotComMarkdownHtml h4 {
  font-size: 1.1em;
  font-weight: 600;
}
.github-DotComMarkdownHtml h5 {
  font-size: 1em;
  font-weight: 600;
}
.github-DotComMarkdownHtml h6 {
  font-size: .9em;
  font-weight: 600;
}
.github-DotComMarkdownHtml h2 {
  padding-bottom: .25em;
  margin-bottom: 0.5em;
  border-bottom: 1px solid #100c15;
}
.github-DotComMarkdownHtml strong {
  color: #f0f0f0;
}
.github-DotComMarkdownHtml del {
  color: #808080;
}
.github-DotComMarkdownHtml a,
.github-DotComMarkdownHtml a code {
  color: #6494ed;
}
.github-DotComMarkdownHtml img {
  max-width: 100%;
}
.github-DotComMarkdownHtml > p {
  margin-top: 0;
  margin-bottom: 1em;
}
.github-DotComMarkdownHtml > ul,
.github-DotComMarkdownHtml > ol {
  margin-bottom: 1em;
  padding-left: 2em;
}
.github-DotComMarkdownHtml li {
  padding-top: .1em;
  padding-bottom: .1em;
}
.github-DotComMarkdownHtml li li {
  font-size: 1em;
}
.github-DotComMarkdownHtml .task-list-item {
  position: relative;
  list-style: none;
}
.github-DotComMarkdownHtml .task-list-item .task-list-item-checkbox {
  position: absolute;
  margin-left: -20px;
}
.github-DotComMarkdownHtml blockquote {
  margin: 1em 0;
  padding: .25em 1em;
  font-size: inherit;
  color: #808080;
  border-color: #100c15;
  border-width: 3px;
}
.github-DotComMarkdownHtml hr {
  margin: 1.5em 25%;
  border-top: 1px solid #100c15;
  background: none;
}
.github-DotComMarkdownHtml table {
  margin: 1em 0;
}
.github-DotComMarkdownHtml th {
  color: #f0f0f0;
}
.github-DotComMarkdownHtml th,
.github-DotComMarkdownHtml td {
  padding: .66em 1em;
  border: 1px solid #100c15;
}
.github-DotComMarkdownHtml pre,
.github-DotComMarkdownHtml code {
  color: #f0f0f0;
  background-color: #30243f;
}
.github-DotComMarkdownHtml pre {
  margin: 1em 0;
}
.github-DotComMarkdownHtml pre > code {
  white-space: pre;
}
.github-DotComMarkdownHtml .highlight {
  margin: 1em 0;
}
.github-DotComMarkdownHtml .highlight pre {
  margin: 0;
}
.github-DotComMarkdownHtml kbd {
  color: #f0f0f0;
  border: 1px solid #100c15;
  border-bottom: 2px solid #010102;
  background-color: #30243f;
}
.github-DotComMarkdownHtml .issue-link {
  color: #808080;
}
.github-DotComMarkdownHtml .js-suggested-changes-blob {
  margin: 1em 0;
}
.github-EmojiReactions:empty {
  display: none;
}
.github-EmojiReactionsGroup {
  margin-right: 20px;
}
